import './card.css'

function Card(props){
  return(
    <div className="card-container">
    <div className="card">
      <img src={props.imgUrl}/>
      <h3>{props.title}</h3>
      <p>{props.description}</p>
      <p><a className="underline-link" href={props.link}>{props.linkTitle}</a></p>
    </div>
    </div>

  );
}
export default Card
